goog.provide("webfont.CssClassName");webfont.CssClassName=function(s){this.joinChar_=s||webfont.CssClassName.DEFAULT_JOIN_CHAR};webfont.CssClassName.DEFAULT_JOIN_CHAR="-";goog.scope(function(){var s=webfont.CssClassName;s.prototype.sanitize=function(s){return s.replace(/[\W_]+/g,"").toLowerCase()};s.prototype.build=function(s){var o=[];for(var e=0;e<arguments.length;e++){o.push(this.sanitize(arguments[e]))}return o.join(this.joinChar_)}});